        filename = Garage_GetSelectedCar().man_texture
      }, 0, SCUI.name_to_id.stat_man_rect)
    end
  else
    UIButtons.SetActive(SCUI.name_to_id.stat_man_lock, true)
    UIButtons.SetActive(SCUI.name_to_id.stat_man_square, false)
    UIButtons.SetActive(SCUI.name_to_id.stat_man_rect, false)
  end
  UIShape.ChangeObjectName(SCUI.name_to_id.stat_class_icon, GUI.class_icon_names[Garage_GetSelectedCar().class])
  if Garage_GetSelectedCar().own_it == true and Garage_GetSelectedCar().allowed == false then
