    UIButtons.ChangeColour(SCUI.name_to_id.stat_car_name, "Locked")
    UIButtons.ChangeColour(SCUI.name_to_id.stat_class_icon, "Locked")
  end
  if Garage_GetSelectedCar().boss == true and Garage_GetSelectedCar().own_it == false then
    UIButtons.SetActive(SCUI.name_to_id.sp_boss_rb_tier_locked, Garage_GetSelectedCar().boss_state == "tier_locked")
    UIButtons.SetActive(SCUI.name_to_id.sp_boss_rb_event_locked, Garage_GetSelectedCar().boss_state == "event_locked")
    UIButtons.SetActive(SCUI.name_to_id.sp_boss_rb_car_locked, Garage_GetSelectedCar().boss_state == "car_locked")
    UIButtons.SetActive(SCUI.name_to_id.sp_boss_lock, Garage_GetSelectedCar().boss_state ~= "car_unlocked")
    AIGamerPicture(SCUI.name_to_id.sp_boss_pic, UIGlobals.boss_avatar_ids[Garage_GetSelectedCar().boss_tier])
    UIButtons.ChangeText(SCUI.name_to_id.sp_boss_name, GUI.sp_boss_info[Garage_GetSelectedCar().boss_tier].name)
    if Garage_GetSelectedCar().boss_state == "tier_locked" then
      UIButtons.ChangeText(SCUI.name_to_id.sp_boss_tier_locked_number, "GAME_NUM_" .. GUI.sp_tier_info[Garage_GetSelectedCar().boss_tier].starRequirement)
    end
    if Garage_GetSelectedCar().boss_state == "car_locked" then
      if Garage_GetSelectedCar().ability ~= -1 then
        UIButtons.ChangeText(SCUI.name_to_id.sp_boss_car_locked_title, UIText.RBC_UNLOCK_THIS_BOSS_CAR)
      else
        UIButtons.ChangeText(SCUI.name_to_id.sp_boss_car_locked_title, UIText.RBC_UNLOCK_THIS_BOSS_CAR_NO_MOD)
