            else
              UIButtons.ChangeColour(SCUI.name_to_id[_FORV_11_ .. "_icon_" .. _FORV_16_], "Main_Black")
            end
          end
        end
        UIButtons.ChangeText(SCUI.name_to_id[_FORV_11_ .. "_name"], "MPL_CAR_CHALLENGE" .. Garage_GetSelectedCar().id .. "_" .. GUI.garage.challenges[Garage_GetSelectedCar().id][_FORV_11_].type .. "_NAME")
        UIButtons.ChangeText(SCUI.name_to_id[_FORV_11_ .. "_desc"], "MPL_CAR_CHALLENGE" .. Garage_GetSelectedCar().id .. "_" .. GUI.garage.challenges[Garage_GetSelectedCar().id][_FORV_11_].type .. "_DESC")
