        UIButtons.ChangeText(SCUI.name_to_id[_FORV_11_ .. "_helptext"], "MPL_CAR_CHALLENGE" .. Garage_GetSelectedCar().id .. "_" .. GUI.garage.challenges[Garage_GetSelectedCar().id][_FORV_11_].type .. "_REWARD")
        UIButtons.ChangeSize(SCUI.name_to_id[_FORV_11_ .. "_progress"], UIButtons.GetSize(SCUI.name_to_id[_FORV_11_ .. "_backing"]) * GUI.garage.challenges[Garage_GetSelectedCar().id][_FORV_11_].progress, UIButtons.GetSize(SCUI.name_to_id[_FORV_11_ .. "_progress"]))
        if _FORV_10_ == 2 then
          UIButtons.SetActive(SCUI.name_to_id.winner_helptext, Garage_GetSelectedCar().respray)
        end
        UIButtons.SetActive(SCUI.name_to_id[_FORV_11_ .. "_icon"], GUI.garage.challenges[Garage_GetSelectedCar().id][_FORV_11_].complete == false and (_FORV_10_ == 1 or _FORV_10_ == 2 and Garage_GetSelectedCar().respray == true))
        UIButtons.SetActive(SCUI.name_to_id[_FORV_11_ .. "_tick"], GUI.garage.challenges[Garage_GetSelectedCar().id][_FORV_11_].complete)
        if GUI.garage.challenges[Garage_GetSelectedCar().id][_FORV_11_].complete == false then
