  elseif ((GUI.is_multiplayer == true and Garage_GetSelectedCar().own_it == true and Garage_GetSelectedCar().has_parent == false or GUI.is_multiplayer == true and Garage_GetSelectedCar().own_it == true and GUI.garage.rank[Garage_GetSelectedCar().id] == 51) == true and Garage_GetSelectedCar().allowed ~= false) == true and GUI.is_multiplayer == true and GUI.viewing_challenges_prev == true and GUI.viewing_challenges == false then
    Garage_ChallengesOnOff(true, true, true)
  end
  Garage_UpdateCarInfoLines()
end
